    public static final double MASS_TOLERANCE = 0.000001;
    public static final double PEAK_TOLERANCE = 0.000001;

    /**
     * test unpacking when masses and peaks are encoded as 32bit floats
     * uses data from an
     */
    @Test
    public void testUnpack32() {
        final ISpectrumPeak[] spectrumPeaks = XTandemUtilities.decodePeaks(ENCODED_DATA1,
                MassResolution.Bits32);
        Assert.assertTrue(spectrumPeaks.length > 4210);  // fix this

        ISpectrumPeak[] alts = buildAlternatePeaks(spectrumPeaks.length);
        for (int i = 0; i < alts.length; i++) {
            ISpectrumPeak found = spectrumPeaks[i];
            ISpectrumPeak alt = alts[i];
            final double delMass = Math.abs(found.getMassChargeRatio() - alt.getMassChargeRatio());
            final double massTolerance = MASS_TOLERANCE * Math.max(1, found.getMassChargeRatio());
            if (delMass >= massTolerance)
                Assert.assertTrue(delMass < massTolerance);
            final float delPeak = Math.abs(found.getPeak() - alt.getPeak());
            final double peakTolerance = PEAK_TOLERANCE * Math.max(1, found.getPeak());
            if (delPeak >= peakTolerance) {
                Assert.assertTrue(delPeak < peakTolerance);
            }
        }

    }

